import React, {Component} from 'react';
import Title from "./Components/Title";
import Content from "./Components/Content.js";
import './App.css';
import { render } from 'react-dom';

class App extends Component {
  render(){
  return (
    <div className="App">
      <header className="App-header">
        <Title></Title>        
      </header>

      <body>
        <Content></Content>
      </body>

    </div>
  );
  }
}

export default App;
